import React from "react";
import style from "./Timer.module.css";

export const Timer = () => {
    return <div className={style.container}>
        <div className={style.values}>
            <div className={style.value}>
                <p className={style.big__text}>

                </p>
            </div>
        </div>
    </div>
}

export default Timer;
